import React, { useState } from 'react'

export default function App() {
  const [task,setTask] = useState("")
  return (
    <div>
      <h1>Add Todo List</h1>
      <input type="text" placeholder='Enter Todo' 
      value={task} onChange={(e)=>{setTask(e.target.value)}}/>
      <button>Add</button>
    </div>
  )
}
